int user_distance() {
  volatile int *key_value = (int *)0xff200050;
  int counter = 0;
  int jump_distance = 0;

  while (*key_value == 1) {
    int innercount = 0;
    for (int i = 0; i < Delaycount; i++) {
      innercount++;
    }
    counter += 1;
    jump_distance = counter;
  }
  counter = 0;
  return jump_distance;
}


