/* Wait for Synchronization function */
void wait_for_vsync() {
  volatile int *pixel_ctrl_ptr =
      (int *)0xFF203020; // pixel controller get the base address of DMA
  register int status;

  *pixel_ctrl_ptr = 1; // start the synchronication process

  status = *(pixel_ctrl_ptr + 3); // read status register at 0xFF20302c
  while ((status & 0x01) != 0) {
    status = *(pixel_ctrl_ptr + 3); // swap
  }
}

