char* reverse(char *buffer, int i, int j)
{
    while (i < j) {
        swap_c(&buffer[i++], &buffer[j--]);
    }
 
    return buffer;
}

void swap_c(char *x, char *y) {
    char t = *x; *x = *y; *y = t;
}

